import { FiHome, FiSearch, FiGlobe } from 'react-icons/fi'

const options = [
    {
        nome: 'Página Inicial',
        icone: FiHome,
    },
    {
        nome: 'Pesquisa',
        icone: FiSearch,
    },
    {
        nome: 'Explorar',
        icone: FiGlobe,
    },
]
export default function SideNav() {

    return (
        <div className=''>
            <ul>
                {options.map((opt => (
                    <li key={opt.nome}>
                        <opt.icone />
                        <h1>{opt.nome}</h1>
                    </li>
                )))}
            </ul>
        </div>
    )
}
